import React, { Component } from 'react'
import './Header.css';
export default class Header extends Component {
    render() {
        return (
            
            <div className="r1">
                
                <h2 className>Rwenzori Airlines</h2><br />
               <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/f/fb/Egyptair.a330-200.su-gce.arp.jpg/1200px-Egyptair.a330-200.su-gce.arp.jpg" alt="" className="r9"/>
               
              <p>
               Rwenzori Airline is aimed at bringing the best in Airline
               travels to you.<br />Our oustanding records among Airlines
               makes us achieve this.<br />Our staff members are adequate and 
               loyal.<br />We are aimed at giving you the best services.    
               <br />
              <input class="btn btn-primary" type="submit" value="Read more"></input><br />
              </p>
            </div>
        )
    }
}
